            lastname : 'lastname'
        }
    ])

    return (
        <div id = 'members'>
            <div id = 'members-block' className = 'flex'>
                <MemberShow />
                <div id = 'member-list'>
                    <div id = 'member-list-block'>

                    </div>
                </div>
            </div>
        </div>
    )
}

export default Members
